const micro = require('micro')
const { createHmac, randomBytes } = require('crypto')
const { json, send } = micro
const { parse } = require('url')
const sleep = ms => new Promise(ok => setTimeout(ok, ms))

const partners = {
  clays: '012345678901234567890123456789'  
}

const result = {
  status: {
    code: 'ok'
  },
  shipmentId: '',
  charges: {
    value: 0,
    currency: 'GBP' 
  },
  documents: [],
  labels: [
    {
      trackingNumber: '1Z3X3F910305063713',
      sendersReference: '20170720122153-0-1',
      payload: '',
      type: 'pdf',
      encoding: 'base64'
    }
  ]
}

const cn22 = {
  type: 'pdf',
  encoding: 'base64',
  payload: '',
  sendersReference: '20170720122153-0-1'
}

function verifySignature(nonce, apiKey) {
  const hmac = createHmac('sha256', apiKey)
  hmac.update(nonce)
  return hmac.digest('base64')
}

function createSignature(partnerId) {
  const apiKey = partners[partnerId]
  const hmac = createHmac('sha256', apiKey)
  const nonce = randomBytes(48).toString('hex')
  hmac.update(nonce)
  const signature = hmac.digest('base64')
  const authorization = `${partnerId}:${signature}`
  return { nonce: nonce, authorization: authorization }
}

function createBadSignature(partnerId) {
  const apiKey = partners[partnerId] + 'ABC'
  const hmac = createHmac('sha256', apiKey)
  const nonce = randomBytes(48).toString('hex')
  hmac.update(nonce)
  const signature = hmac.digest('base64')
  const authorization = `${partnerId}:${signature}`
  return { nonce: nonce, authorization: authorization }
}

micro(async (req, res) => {
  const nonce = req.headers['x-siteflow-nonce']
  const [ partnerId, signature ] = req.headers['x-siteflow-signature'].split(':')
  console.log(`${partnerId} : ${signature} : ${nonce}`)
  req.url = parse(req.url)
  console.log(`${req.method}: ${req.url.path}`)
  if (req.method !== 'POST') {
    return send(res, 404, { status: { code: 'error', message: 'method not supported' } })
  }
  if (req.url.path !== '/shipment') {
    return send(res, 404, { status: { code: 'error', message: 'path not found' } })
  }
  const apiKey = partners[partnerId]
  if (!apiKey) {
    return send(res, 401, { status: { code: 'error', message: 'partner not found' } })
  }
  const verification = verifySignature(nonce, apiKey)
  if(verification !== signature) {
    return send(res, 401, { status: { code: 'error', message: 'signature does not match' } })
  }
  const { shipmentId, orderNumber, packages, shipTo, output } = await json(req)
  result.shipmentId = shipmentId
  const [ label ] = result.labels
  if(packages && packages.length) {
    label.sendersReference = packages[0].referenceNumber
  } else {
    return send(res, 400, { status: { code: 'error', message: 'no packages found on shipment' } })
  }
  if (orderNumber.length < 10) {
    return send(res, 400, { status: { code: 'error', message: 'bad order id' } })
  }
  let auth
  if (orderNumber === '0123456789') {
    auth = createBadSignature(partnerId)
  } else {
    auth = createSignature(partnerId)
  }
  res.setHeader('X-Siteflow-Nonce', auth.nonce)
  res.setHeader('X-Siteflow-Signature', auth.authorization)
  const payload = JSON.parse(JSON.stringify(result))
  if (shipTo.isoCountry !== 'GB') {
    payload.documents.push(cn22)
  }
  if (output.format === 'zpl') {
    payload.labels[0].payload = ''
    payload.labels[0].type = 'zpl'
  }
  if (orderNumber === 'BADLABEL01') {
    payload.labels[0].payload = null; // should fail validation
  }
  send(res, 200, payload)
}).listen(process.env.PORT || 8999)
